import React from 'react'
import './intro.css'
import bg from '../../assets/myimage.png';
import {Link} from 'react-scroll';
import btnImg from '../../assets/hireme.png';

const Intro = () => {
  return (
    <section id="intro">
        <div className="introContent">
        <span className="hello">Hello,</span>
        <span className="introText">I'm <span className="introName">Ayaan Shaikh</span> <br />Website Developer</span>
       <p className="introPara">I'm a full stack developer looking for a position where my experiance <br /> and education can be utilized.</p>
       <Link><button className="btn"><img src={btnImg} alt=""  className='btnImg'/>Hire Me</button></Link>
        </div>
        <img src={bg} alt="profile" className="bg" />
    </section>

  )
}

export default Intro;
